import React from 'react';
import MaterialTable from 'material-table';

const RoomInputGrid = () => {
    return (
        <MaterialTable
          columns={[
            { title: "Ad", field: "name" },
            { title: "Soyad", field: "surname" },
            { title: "Doğum", field: "birthYear", type: "numeric" },
          ]}
          data={[
            { name: "Mehmet", surname: "Baran", birthYear: 1987 },
            { name: "Mehmet", surname: "Baran", birthYear: 1987 },
            { name: "Mehmet", surname: "Baran", birthYear: 1987 }
          ]}
          title="Room Construction"
          editable={{
            isEditable: rowData => rowData.name === "a", // only name(a) rows would be editable
            isDeletable: rowData => rowData.name === "b", // only name(a) rows would be deletable
            onRowAdd: newData => { return; },
            onRowUpdate: (newData, oldData) =>{return; },
            onRowDelete: oldData => {return; }

        }}
        />
    );
};

export default RoomInputGrid;
